import { NavLink } from "react-router-dom";
import "../styles/Header.css";

const links = [
  {
    title: "Medinova",
    link: "/"
  },

  {
    title: "Login",
    link: "/login"
  },

  {
    title: "Signup",
    link: "/signup"
  },


 
];
export const Nav = () => {
  return(
    //map through the link ad display it in header
     <div>
       {links.map(({title, link}, index) => {
             return <NavLink key={index} to={link} style={{textDecoration: 'none', margin: 'auto'}}>
                <div className="nav">
                        {/* <h1 style={{fontSize: 28}}>MEDINOVA</h1> */}

                        

                        <button className="login" to>login</button>

                       
                </div>
             </NavLink>
       })}
     </div>

  );
};
